(2, 'มะม่วงน้ำดอกไม้ 40บ / กิโลกรัม', 'มะม่วงดินเอียด รสชาติอร่อย กลมกล่อม เป็นเอกลักษณ์ของมะม่วงอำเภอบ้านไผ่ ปลอดภัย ได้รับรองมาตรฐาน GAP จากกรมวิชาการเกษตร ใส่ใจทุกกระบวนการผลิต มีพร้อมเสริร์ฟตามฤดูกาล มกราคม - สิงหาคม ของทุกปี ราคามีมิตรภาพ', 40.00, 7, 100, 1, '2024-08-24 02:07:25', '2024-09-15 03:06:29'),
(3, 'มะม่วงกวน 60บ / กล่อง', 'เนื้อมะม่วงสุกจากสวน ใช้เนื้อมะม่วงล้วน ไม่ผสมแบะแซ ไม่ใส่วัตถุกันเสีย ตากในโดมพลังงานแสงอาทิตย์ ป้องกันฝุ่นและแมลง เก็บได้นาน 5-6 เดือน', 60.00, 7, 70, 1, '2024-08-24 02:09:36', '2024-09-15 03:08:08'),
(8, 'มะม่วงกวนสอดไส้  25บ / กล่อง', 'ผลไม้แปรรูปแม่สมบูรณ์ ได้ก่อตั้งขึ้น เมื่อประมาณ 10 กว่าปีที่แล้ว ในสมัยนั้น แม่สมบูรณ์ได้นำสับปะรดที่ปลูกในไร่ไปขายที่โรงงาน ในช่วงเวลานั้นมีเกษตรกรปลูกสับปะรดจำนวนมากจนล้นตลาด ทำให้ราคาตกต่ำ “แม่สมบูรณ์” เครียดมากเพราะได้ทำการกู้หนี้ยืมสินมาทำการเพาะปลูก วันหนึ่งแม่สมบูรณ์ได้เดินทางกลับจากส่งสับปะรดที่โรงงานได้พบเห็นหญิงชราขี่จักรยานขายของ จึงได้จอดรถซื้อและได้เห็นว่ามีสับปะรดกวนกล่องเล็กๆ จำหน่ายจึงได้ทดลองซื้อมาชิม ซึ่งมีรสชาติอร่อย และคิดว่าต้องการทำสับปะรดกวนดูบ้าง หลังจากแม่สมบูรณ์เดินทางกลับมาถึงบ้านก็ได้ทำการทดลองกวน โดยใช้มือกวน ลองผิดลองถูกเพื่อหารสชาติที่ถูกปากผู้บริโภค ซึ่งหลังจากที่ได้มีการนำสับปะรดกวนไปจำหน่าย พบว่าผู้บริโภคเกิดความพึงพอใจและมีการสั่งซื้อเพิ่มขึ้น จากเดิมทำเพียง 1 หม้อ จึงได้ทำการพัฒนา โดยการคิดค้นเครื่องกวนขึ้นมา ซึ่งสามารถผลิตสินค้าได้จำนวนมากขึ้นตามความต้องการของลูกค้า แต่เนื่องจากสับปะรดกวนแม่สมบูรณ์เป็นที่ต้องการของลูกค้าจำนวนมาก เราจึงได้เพิ่มกำลังการผลิต โดยเพิ่มเครื่องจักรที่มีมาตรฐานแต่ยังคงไว้ซึ่งภูมิปัญญาของชาวบ้านเน้นใส่ใจในในเรื่องของความสะอาดเพื่อให้ผู้บริโภคมั่นใจว่าสามารถรับประทานได้อย่างปลอดภัยและถูกสุขลักษณะ\r\n\r\nต่อมาในภายหลัง ผลไม้แปรรูปตราแม่สมบูรณ์ ได้เพิ่มการแปรรูปโดยมี มะม่วงกวน กล้วยกวน และสินค้าอื่นๆ อีกมากมาย ซึ่งรับซื้อวัตถุดิบจากชาวสวนในพื้นที่และนอกพื้นที่ จากการพัฒนาสินค้าอย่างต่อเนื่อง รสชาติคงไว้ซึ่งความอร่อยอยู่เสมอ รักษาคุณภาพสินค้าได้ดีตลอดมา ทำให้ปัจจุบันผลไม้แปรรูปตราแม่สมบูรณ์เป็นที่รู้จักกันอย่างแพร่หลายในท้องตลาดทั้งปลีก/ส่ง', 25.00, 9, 70, 1, '2024-08-24 05:57:02', '2024-09-15 03:10:39'),
(9, 'มะม่วงกวนอบแห้ง 100บ / กล่อง (500 กรัม)', 'เราปลูกมะม่วงเอง ใส่ปุ๋ยเอง ตัดแต่งกิ่งเอง รดน้ำเอง เก็บมะม่วงเอง และคัดคุณภาพมะม่วงเอง เรามีความชำนาญในการผลิต เรามีโรงงานมาตรฐาน GMP เรามีสินค้า อย. สด สะอาด จึงการันตีได้ว่า คุณจะได้ลิ้มชิมรส มะม่วงแช่อิ่ม แม่ซู้กิม มะม่วงแช่อิ่ม กรอบ ไร้เสี้ยน สด สะอาด รวมถึงมะม่วงกวน จากการปลูกสวนมะม่วงมากกว่า 30 ปี สู่การแปรรูปเพื่อการบริโภคได้ทุกฤดูกาล ผ่านการปรุงเพื่อให้ได้รสชาติที่อร่อย ถูกใจ กรอบ ไม่มีเสี้ยน ไม่ซ่าลิ้น ไม่แสบคอ แพ็คละ 59 บาท (ขนาด 250 กรัม) และกล่องละ 59 บาทเท่านั้น ส่งฟรีทั่วไทย', 100.00, 9, 70, 1, '2024-08-24 05:57:09', '2024-09-15 03:11:44'),
(11, 'เม็ดมะม่วงหิมพานต์คั่วเกลือ 35บ / ถุง (60 กรัม)', 'เม็ดมะม่วงหิมพานต์คั่วเกลือ (ถุง 60 กรัม)\r\n\r\nผลิตภัณฑ์จากวิสาหกิจชุมชนบ้านไร่จันทกานต์ โดยมีนางสาวจันทกานต์ พาผล (ประธานกลุ่มและเป็นเกษตรกรรุ่นใหม่', 35.00, 6, 50, 1, '2024-09-15 03:14:24', '2024-09-15 03:14:35'),
(12, 'เม็ดมะม่วงหิมพานต์คั่วเกลือ 200บ / ถุง (500 กรัม)', 'เม็ดมะม่วงหิมพานต์คั่วเกลือ (ถุง 500 กรัม)\r\n\r\nผลิตภัณฑ์จากวิสาหกิจชุมชนบ้านไร่จันทกานต์ โดยมีนางสาวจันทกานต์ พาผล (ประธานกลุ่มและเป็นเกษตรกรรุ่นใหม่ หรือYSF ของม.2 ตำบลท่าเมือง )', 200.00, 6, 150, 1, '2024-09-15 03:15:41', '2024-09-15 03:15:41'),
(13, 'มะม่วงแดนเปือยน้อย มะม่วงเขียวเสวย น้ำดอกไม้สีทอง 50บ / กิโลกรัม', 'มะม่วงแดนเปือยน้อย\r\n\r\nมะม่วงเขียวเสวย น้ำดอกไม้สีทอง\r\n\r\nหอม หวาน อร่อย ได้รับรองมาตรฐาน GAP\r\n\r\nการันตี ความสด สะอาด ปลอดภัย\r\n\r\nจัดจำหน่ายทั้งในและนอกฤดูกาล\r\n\r\nค่าจัดส่ง 100 บาท/แพ็ค', 50.00, 10, 100, 1, '2024-09-15 03:19:56', '2024-09-15 03:20:39'),
(14, 'มะม่วงแช่อิ่ม 40บ / ถุง (300 กรัม)', 'มะม่วงแช่อิ่ม มีรสหวานอมเปรี้ยว อร่อยถูกปาก รสชาติถูกใจ เราใส่ใจทุกขั้นตอนการผลิตโดยวิธีธรรมชาติ ปราศจากสารอันตรายต่อร่างกาย ที่สำคัญ \"ไม่ใส่สารกันบูด\"\r\n\r\nมะม่วงแช่อิ่มเป็นสินค้าดีจากวิสาหกิจชุมชน วิถีเกษตรกรรมแปรรูปจอมบึง บ้านชุกหว้า ตำบลจอมบึง อำเภอจอมบึง จังหวัดราชบุรี มีการแปรรูป พัฒนาผลิตภัณฑ์อันหลากหลาย สามารถสร้างรายได้หลังจากอาชีพหลัก และยังมุ่งมั่นสร้างสรรค์ ผลิตภัณฑ์จากภูมิปัญญาเกษตรผสมผสานที่เป็นมิตรกับสิ่งแวดล้อม ด้วยพลังงานธรรมชาติจากแสงแดดนำมาอบ ตากแห้ง ด้วยโรงเรือนมาตรฐาน และผลิตภัณฑ์อื่นๆ อันหลากหลาย ควบคุมและใส่ใจทุกขั้นตอนการผลิต ภายใต้มาตรฐานการรับรองจาก \"สำนักงานคณะกรรมการอาหารและยา (อย.)\" เพื่อส่งต่อสิ่งดี ๆ มีคุณภาพ ให้กับผู้บริโภค \"เพราะคุณคือคนสำคัญ\"', 40.00, 10, 150, 1, '2024-09-15 03:22:08', '2024-09-15 03:22:08');

